import React from 'react';


export default function TimelineCard({iconURL,year,content}){
    return(
        <div class="d-flex flex-grow-1 flex-row col-md-4 mb-8 ">

            <p class="mb-md-0">{year} </p>
            <span style={{
                    borderLeft:'6px solid green',height:"100%"
                }}></span>
            <figure className='u-icon u-icon--md'>
                <img src={iconURL} alt='icon' />

            </figure>
            <p>
                {content}
            </p>
        </div>
    )
}
